import React from "react";
import './movieRow.css';

export default ({title, items}) => {
    return (
        <div>
            <h2>{title}</h2>
            <div className="movieRow--listarea">
                <div className=""></div>



            {items?.results?.map((item, key)=> (
            <img key={key} src={`https://image.tmdb.org/t/p/w300${item.poster_path}`}/>
            ))}
            </div>
        </div>
    );
}
